import React, { useState } from 'react'
import Input from './Input'

const Login = () => {
  const [inputs,setInputs]=useState({login:"",password:""})
  const handleSubmit=(e)=>{
    e.preventDefault()
  }
  return (
    <div className='login'>
        <h1>Login</h1>
        <form onSubmit={handleSubmit}>
          <Input
            name="login"
            inputs={inputs}
            setInputs={setInputs}
            type="text"
            placeholder="Email"
          />
          <Input
            name="password"
            inputs={inputs}
            setInputs={setInputs}
            type="text"
            placeholder="Email"
          />
        </form>
    </div>
  )
}

export default Login
